selector_to_html = {"a[href=\"#term-num_pixel_xy\"]": "<dt id=\"term-num_pixel_xy\">num_pixel_xy</dt><dd><p>The number of pixels [X, Y] in each <a class=\"reference internal\" href=\"#term-region-of-interest\"><span class=\"xref std std-term\">region-of-interest</span></a>.</p></dd>", "a[href=\"#term-pixel-resolution\"]": "<dt id=\"term-pixel-resolution\">pixel-resolution</dt><dd><p>The size, in micron, of each pixel.</p></dd>", "a[href=\"#external-resources\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">External Resources<a class=\"headerlink\" href=\"#external-resources\" title=\"Permalink to this heading\">#</a></h2><h3>Software<a class=\"headerlink\" href=\"#software\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"#light-beads-microscopy-data\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Light Beads Microscopy Data<a class=\"headerlink\" href=\"#light-beads-microscopy-data\" title=\"Permalink to this heading\">#</a></h2><p>Current Light Beads Microscopy (LBM) data is aquired with ScanImage aquisition software.</p><p>ScanImage <a class=\"reference external\" href=\"https://docs.scanimage.org/Premium+Features/Multiple+Region+of+Interest+(MROI).html\">Multi Region Of Interest (mROI)</a> outputs raw <code class=\"docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> files made up of individual <code class=\"docutils literal notranslate\"><span class=\"pre\">Regions</span> <span class=\"pre\">of</span> <span class=\"pre\">Interest</span> <span class=\"pre\">(ROI's)</span></code>.</p>", "a[href=\"#miller-brain-observatory-compute-ecosystem\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Miller Brain Observatory: Compute Ecosystem<a class=\"headerlink\" href=\"#miller-brain-observatory-compute-ecosystem\" title=\"Permalink to this heading\">#</a></h1><p>A hub for tutorials, guides and resources for computational image processing.</p>", "a[href=\"#term-region-of-interest\"]": "<dt id=\"term-region-of-interest\">region-of-interest</dt><dd><p>A set of 1 or more 2D planes which are stitched together to form the full image.</p></dd>", "a[href=\"ref.html#multipage-tiff\"]": "<figure class=\"align-default\" id=\"multipage-tiff\">\n<img alt=\"Multipage Tiff\" src=\"_images/gen_array_page.gif\"/>\n<figcaption>\n<p><span class=\"caption-text\">MultiPage Tiff</span><a class=\"headerlink\" href=\"#multipage-tiff\" title=\"Permalink to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#software\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Software<a class=\"headerlink\" href=\"#software\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"ref.html#ex-deinterleave\"]": "<figure class=\"align-default\" id=\"ex-deinterleave\">\n<img alt=\"ex_deinterleave\" src=\"_images/ex_deinterleave.svg\"/><figcaption>\n<p><span class=\"caption-text\">De-interleave Z-Planes</span><a class=\"headerlink\" href=\"#ex-deinterleave\" title=\"Permalink to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#term-image-length\"]": "<dt id=\"term-image-length\">image-length</dt><dd><p>The number of pixels on the long axis of the raw <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> file.</p></dd>", "a[href=\"#term-Field-of-view\"]": "<dt id=\"term-Field-of-view\">Field-of-view</dt><dd><p>The total size (um) of the raw stitched image with no trimming operations.</p></dd>", "a[href=\"#term-image-width\"]": "<dt id=\"term-image-width\">image-width</dt><dd><p>The number of pixels on the short, slow-galvo axis of the raw <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> file.</p></dd>", "a[href=\"#term-roi_width_px\"]": "<dt id=\"term-roi_width_px\">roi_width_px</dt><dd><p>The size of the <a class=\"reference internal\" href=\"#term-region-of-interest\"><span class=\"xref std std-term\">region-of-interest</span></a> on its shortest dimension.</p></dd>", "a[href=\"#using-metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Using Metadata<a class=\"headerlink\" href=\"#using-metadata\" title=\"Permalink to this heading\">#</a></h2><p>Each pipeline comes stocked with methods to retrieve imaging metadata.</p>", "a[href=\"#terms\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Terms<a class=\"headerlink\" href=\"#terms\" title=\"Permalink to this heading\">#</a></h2><p>Light-beads microscopy is a 2-photon imaging paradigm based on <a class=\"reference external\" href=\"https://docs.scanimage.org/index.html\">ScanImage</a> acquisition software.</p>", "a[href=\"ref.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Image Gallery<a class=\"headerlink\" href=\"#image-gallery\" title=\"Permalink to this heading\">#</a></h1><p>A place to put rendered content to allow tooltips to render images within the tooltip.</p>", "a[href=\"#pipelines\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pipelines<a class=\"headerlink\" href=\"#pipelines\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"#blogs-and-posts\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Blogs and Posts<a class=\"headerlink\" href=\"#blogs-and-posts\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"#frame-ordering\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Frame Ordering<a class=\"headerlink\" href=\"#frame-ordering\" title=\"Permalink to this heading\">#</a></h2><p>ScanImage saves the 4D data with each plane <a class=\"reference internal\" href=\"ref.html#ex-deinterleave\"><span class=\"std std-ref\">De-interleave Z-Planes</span></a>, e.g:</p>", "a[href=\"#understanding-metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Understanding Metadata<a class=\"headerlink\" href=\"#understanding-metadata\" title=\"Permalink to this heading\">#</a></h2><p id=\"scanimage-metadata\">ScanImage stores metadata about image size, frame rate, resolution, and regions of interest within the raw <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> file. Each pipeline handles this metadata for you, and provides an interface to use these values throughout the pipeline.</p><p>There is primary metadata, intended for use in a typical processing run. Many of these values are derived from less-pertinent (secondary) metadata.</p>", "a[href=\"#term-roi_height_px\"]": "<dt id=\"term-roi_height_px\">roi_height_px</dt><dd><p>The size of the <a class=\"reference internal\" href=\"#term-region-of-interest\"><span class=\"xref std std-term\">region-of-interest</span></a> on its longest dimension.</p></dd>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
